<script>
export default {
  middleware: ['authenticated'],
  data() {
    return {
      order: {
        loading: true,
        data: null,
      },
      collect: {
        loading: true,
        data: null,
      },
      confirmationCancel: {
        popup: false,
      },
      axiosCancelToken: null,
    }
  },
  computed: {
    wasteWeight() {
      let wasteWeight = 0

      wasteWeight = this.collect?.data?.collect_items.reduce(
        (sum, data) => sum + data.weight,
        ''
      )

      return wasteWeight
    },
  },
  mounted() {
    this.$axios.setToken(this.$store.state.authentication.token, 'Bearer')
    this.getOrderDetail()
    this.getcollectDetail()
  },
  created() {
    this.axiosCancelToken = this.$axios.CancelToken.source()
  },
  destroyed() {
    this.axiosCancelToken.cancel()
  },
  methods: {
    async getOrderDetail() {
      try {
        this.order.loading = true

        let id = this.$route.params.id
        var response = await this.$axios.$get(`/api/v1/order/${id}`, {
          CancelToken: this.axiosCancelToken,
        })

        this.order.loading = false
        if (response.success) {
          this.order.data = response.data
        }
      } catch (error) {
        this.order.loading = false
        if (!this.$axios.isCancel(error)) {
          const code = parseInt(error.response && error.response.status)
          const statusText = error.response && error.response.statusText
          const data = error.response && error.response.data

          if (code === 404) {
            this.$nuxt.context.error({
              statusCode: 404,
              message: data.message,
            })
            return Promise.resolve(false)
          }
        }
      }
    },
    async getcollectDetail() {
      try {
        this.collect.loading = true

        let id = this.$route.params.id
        var response = await this.$axios.$get(`/api/v1/order/${id}/collect`, {
          CancelToken: this.axiosCancelToken,
        })

        this.collect.loading = false
        if (response.success) {
          this.collect.data = response.data
        }
      } catch (error) {
        this.collect.loading = false
        if (!this.$axios.isCancel(error)) {
          const code = parseInt(error.response && error.response.status)
          const statusText = error.response && error.response.statusText
          const data = error.response && error.response.data

          if (code === 404) {
            this.$nuxt.context.error({
              statusCode: 404,
              message: data.message,
            })
            return Promise.resolve(false)
          }
        }
      }
    },
    async cancelOrder() {
      try {
        this.confirmationCancel.popup = false
        this.$store.commit('app/setLoader', true)
        let id = this.$route.params.id

        let data = {
          status: 'cancel',
        }
        var response = await this.$axios.$post(`/api/v1/order/${id}`, data, {
          CancelToken: this.axiosCancelToken,
        })

        this.$store.commit('app/setLoader', false)
        if (response.success) {
          this.getOrderDetail()
          this.getcollectDetail()
        }
      } catch (error) {
        this.$store.commit('app/setLoader', false)
        if (!this.$axios.isCancel(error)) {
          const code = parseInt(error.response && error.response.status)
          const statusText = error.response && error.response.statusText
          const data = error.response && error.response.data

          if (code === 404) {
            this.$nuxt.context.error({
              statusCode: 404,
              message: data.message,
            })
            return Promise.resolve(false)
          }
        }
      }
    },
    async payOrder() {
      try {
        this.$store.commit('app/setLoader', true)
        let id = this.order.data.payment.id

        let data = {
          status: 'paid',
        }
        var response = await this.$axios.$post(`/api/v1/payment/${id}`, data, {
          CancelToken: this.axiosCancelToken,
        })

        this.$store.commit('app/setLoader', false)
        if (response.success) {
          this.setActiveOrder()
        }
      } catch (error) {
        this.$store.commit('app/setLoader', false)
        if (!this.$axios.isCancel(error)) {
          const code = parseInt(error.response && error.response.status)
          const statusText = error.response && error.response.statusText
          const data = error.response && error.response.data

          if (code === 404) {
            this.$nuxt.context.error({
              statusCode: 404,
              message: data.message,
            })
            return Promise.resolve(false)
          }
        }
      }
    },
    async setActiveOrder() {
      try {
        this.$store.commit('app/setLoader', true)
        let id = this.$route.params.id

        let data = {
          status: 'active',
        }
        var response = await this.$axios.$post(`/api/v1/order/${id}`, data, {
          CancelToken: this.axiosCancelToken,
        })

        this.$store.commit('app/setLoader', false)
        if (response.success) {
          this.getOrderDetail()
          this.getcollectDetail()
        }
      } catch (error) {
        this.$store.commit('app/setLoader', false)
        if (!this.$axios.isCancel(error)) {
          const code = parseInt(error.response && error.response.status)
          const statusText = error.response && error.response.statusText
          const data = error.response && error.response.data

          if (code === 404) {
            this.$nuxt.context.error({
              statusCode: 404,
              message: data.message,
            })
            return Promise.resolve(false)
          }
        }
      }
    },
  },
}
</script>
